import React, { useEffect } from 'react'
import '../components/components.css'
import axios from 'axios'

function Home() {
    useEffect(() => {
        fetch('http://localhost:1337/events')
            .then(res => {
                res.json();
            })
            .then((data) => {
                console.log(data);
            })
    }, [])

    return(
        <div className="information">YES</div>
    );
}

export default Home
